  WHERE u.UserGroupID = v_UserGroupID
  ORDER BY u.UserGroupID;
END
$$

--
-- Create procedure `Proc_GetFindMemberInUserGroup`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetFindMemberInUserGroup (IN v_SearchWord varchar(255), IN v_UserGroupID int)
BEGIN
  DROP TEMPORARY TABLE IF EXISTS tbMembersInUserGroup;
  CREATE TEMPORARY TABLE tbMembersInUserGroup (SELECT DISTINCT
      u.UserGroupID,
      u.UserGroupName,
      u.Description,
      u.SortOrder,
      u2.UserID AS MemberID,
      CONCAT(u2.FirstName, ' ', u2.LastName) AS MemberName,
      u2.Email,
      CONCAT(j.JobTitleName, ' - ', o1.OrganizationUnitName, ' - ', o.OrganizationName) AS MemberDescription,
      u.Status
    FROM usergroup u
      LEFT JOIN usergroupdetail u1
        ON u.usergroupid = u1.UserGroupID
      LEFT JOIN user u2
        ON u1.UserID = u2.userid
      LEFT JOIN jobtitle j
        ON u2.JobTitleID = j.jobtitleid
      LEFT JOIN organization o
        ON u2.OrganizationID = o.organizationid
      LEFT JOIN organizationunit o1
        ON u2.OrganizationUnitID = o1.organizationunitid
    WHERE u.UserGroupID = v_UserGroupID
    ORDER BY u.UserGroupID);

  SELECT
    *
  FROM tbMembersInUserGroup miug
  WHERE (v_SearchWord IS NULL)
  OR miug.MemberName LIKE CONCAT('%', v_SearchWord, '%')
  OR miug.Email LIKE CONCAT('%', v_SearchWord, '%')
  OR miug.MemberDescription LIKE CONCAT('%', v_SearchWord, '%');
END
$$

--
-- Create procedure `Proc_GetFindAndPagingUserGroup`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetFindAndPagingUserGroup (IN v_PageNumber int, IN v_PageSize int, IN v_SearchWord varchar(255), OUT v_TotalPage int, OUT v_TotalRecord int, OUT v_UserGroupStart int, OUT v_UserGroupEnd int)
BEGIN
  # Lấy dữ liệu của teacher cho vào bảng tạm tbTeacherFilter
  DROP TEMPORARY TABLE IF EXISTS tbUserGroup;

  CREATE TEMPORARY TABLE tbUserGroup AS (SELECT DISTINCT
      u.UserGroupID,
      u.UserGroupName,
      u.Description,
      u.SortOrder,
      COUNT(DISTINCT (u2.UserID)) AS MemberCount,
      u.Status
    FROM usergroup u
      LEFT JOIN usergroupdetail u1
        ON u.usergroupid = u1.UserGroupID
      LEFT JOIN user u2
        ON u1.UserID = u2.userid
      LEFT JOIN organization o
        ON u2.OrganizationID = o.organizationid
      LEFT JOIN organizationunit o1
        ON u2.OrganizationUnitID = o1.organizationunitid
    WHERE (v_SearchWord IS NULL)
    OR u.UserGroupName LIKE CONCAT('%', v_SearchWord, '%')
    GROUP BY u.UserGroupID
    ORDER BY u.UserGroupID);

  SET v_TotalRecord = (SELECT
      COUNT(1)
    FROM tbUserGroup);
  SET v_TotalPage = CEIL(v_TotalRecord / v_PageSize);

  SET v_PageNumber = (v_PageNumber - 1) * v_PageSize;
  SET v_UserGroupStart = v_PageNumber + 1;

  SELECT
    *
  FROM tbUserGroup LIMIT v_PageSize OFFSET v_PageNumber;
  SET v_UserGroupEnd = v_PageNumber + (SELECT
      COUNT(*)
    FROM (SELECT
        *
      FROM tbUserGroup LIMIT v_PageSize OFFSET v_PageNumber) t);
END
$$

--
-- Create procedure `Proc_GetFindAndPagingUser`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetFindAndPagingUser (IN v_PageNumber int, IN v_PageSize int, IN v_SearchWord varchar(255), OUT v_TotalRecord int, OUT v_TotalPage int, IN v_TagUserGroup varchar(255), OUT v_UserStart int, OUT v_UserEnd int, IN v_TagJobTitle varchar(255), IN v_TagOrganization varchar(255))
BEGIN
  # Lấy dữ liệu của teacher cho vào bảng tạm tbTeacherFilter
  DROP TEMPORARY TABLE IF EXISTS tbUserWithFullName;
  DROP TEMPORARY TABLE IF EXISTS tbUserFilter;

  CREATE TEMPORARY TABLE tbUserWithFullName AS (SELECT DISTINCT
      u.UserID,
      CONCAT(u.FirstName, ' ', u.LastName) AS FullName,
      u.FirstName,
      u.LastName,
      u.Email,
      u.Mobile,
      u.WorkPhone,
      u.JobTitleID,
      j.JobTitleName,
      u.OrganizationUnitID,
      o1.OrganizationUnitName,
      u.OrganizationID,
      o.OrganizationName,
      GROUP_CONCAT(DISTINCT u2.UserGroupID ORDER BY u2.UserGroupID DESC SEPARATOR ', ') UserGroupIDs,
      GROUP_CONCAT(DISTINCT u2.UserGroupName ORDER BY u2.UserGroupName DESC SEPARATOR ', ') UserGroupName,
      u.Status
    FROM user u
      LEFT JOIN usergroupdetail u1
        ON u.UserID = u1.UserID
      LEFT JOIN usergroup u2
        ON u1.UserGroupID = u2.UserGroupID
      LEFT JOIN jobtitle j
        ON u.JobTitleID = j.JobTitleID
      LEFT JOIN organization o
        ON u.OrganizationID = o.OrganizationID
      LEFT JOIN organizationunit o1
        ON u.OrganizationUnitID = o1.OrganizationUnitID
    GROUP BY u.UserID
    ORDER BY u.LastName);

  CREATE TEMPORARY TABLE tbUserFilter AS (SELECT
      *
    FROM tbUserWithFullName
    WHERE ((v_SearchWord IS NULL)
    OR tbUserWithFullName.FullName LIKE CONCAT('%', v_SearchWord, '%')
    OR tbUserWithFullName.Email LIKE CONCAT('%', v_SearchWord, '%')
    OR tbUserWithFullName.Mobile LIKE CONCAT('%', v_SearchWord, '%'))
    AND ((v_TagUserGroup IS NULL)
    OR tbUserWithFullName.UserGroupName LIKE CONCAT('%', v_TagUserGroup, '%'))
    AND ((v_TagJobTitle IS NULL)
    OR CONCAT(',', v_TagJobTitle, ',') LIKE CONCAT('%,', tbUserWithFullName.JobTitleName, ',%'))
    AND ((v_TagOrganization IS NULL)
    OR tbUserWithFullName.OrganizationName LIKE CONCAT('%', v_TagOrganization, '%')
    OR tbUserWithFullName.OrganizationUnitName LIKE CONCAT('%', v_TagOrganization, '%')));

  SET v_TotalRecord = (SELECT
      COUNT(1)
    FROM tbUserFilter);
  SET v_TotalPage = CEIL(v_TotalRecord / v_PageSize);

  SET v_PageNumber = (v_PageNumber - 1) * v_PageSize;
  SET v_UserStart = v_PageNumber + 1;

  SELECT
    *
  FROM tbUserFilter LIMIT v_PageSize OFFSET v_PageNumber;
  SET v_UserEnd = v_PageNumber + (SELECT
      COUNT(*)
    FROM (SELECT
        *
      FROM tbUserFilter LIMIT v_PageSize OFFSET v_PageNumber) t);
END
$$

