CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_AddListUser (IN v_ListUser varchar(16000))
BEGIN
  DROP TEMPORARY TABLE IF EXISTS users;
  CREATE TEMPORARY TABLE users AS (SELECT
      *
    FROM JSON_TABLE (v_ListUser,
    "$[*]"
    COLUMNS (
    UserID varchar(36) PATH "$.UserID",
    FullName varchar(100) PATH "$.FullName",
    FirstName varchar(100) PATH "$.FirstName",
    LastName varchar(100) PATH "$.LastName",
    Email varchar(50) PATH "$.Email",
    Mobile varchar(50) PATH "$.Mobile",
    WorkPhone varchar(50) PATH "$.WorkPhone",
    JobTitleID int(11) PATH "$.JobTitleID",
    OrganizationUnitID int(11) PATH "$.OrganizationUnitID",
    OrganizationID int(11) PATH "$.OrganizationID",
    Status int(11) PATH "$.Status"
    )
    ) AS jt);
  INSERT user (UserID, FullName, FirstName, LastName, Email, Mobile, WorkPhone, JobTitleID, OrganizationUnitID, OrganizationID, Status)
    SELECT
      u.UserID,
      u.FullName,
      u.FirstName,
      u.LastName,
      u.Email,
      u.Mobile,
      u.WorkPhone,
      u.JobTitleID,
      u.OrganizationUnitID,
      u.OrganizationID,
      u.Status
    FROM users u;
